import React from "react";
import dog from "./dog.jpg";
import "./cardHeader.css";
import {DiPhp} from "react-icons/di";

export class CardHeader extends React.Component{

    render(){
        return(
            <div id="card1_header">
                <header>
                    <h1>Your Courses</h1>
                    <button>PREMIUM</button>
                    <img src={dog} alt="this the dog"/>
                    <p>26 courses</p>
                </header>

            </div>
        );
    }
}
